selector_to_html = {"a[href=\"barcode.html#code-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">C\u00f3digo 128<a class=\"headerlink\" href=\"#code-128\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id20\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#standdard-25-iata-25\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Standdard 25/IATA 25<a class=\"headerlink\" href=\"#standdard-25-iata-25\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id61\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes de volumen<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><h3>Volumen bajo<a class=\"headerlink\" href=\"#low-volume\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo lanzador de teclas<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Pulse el bot\u00f3n para activar el escaneo, y suelte el bot\u00f3n para finalizar la exploraci\u00f3n. El escaneo termina cuando el escaneo es exitoso o el tiempo de lectura excede el tiempo de lectura simple.</p>", "a[href=\"barcode.html#nec-25-coop25\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">NEC-25(COOP25)<a class=\"headerlink\" href=\"#nec-25-coop25\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id91\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#composite\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">COMPOSITE<a class=\"headerlink\" href=\"#composite\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id98\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Terminador<a class=\"headerlink\" href=\"#terminator\" title=\"Link to this heading\">#</a></h1><h2>Configuraci\u00f3n de End Caracter<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>El car\u00e1cter final se a\u00f1ade despu\u00e9s de los datos decodificados en el formato de datos decodificados + car\u00e1cter final.</p>", "a[href=\"barcode.html#bookland-ean-isbn\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Librer\u00eda EAN(ISBN)<a class=\"headerlink\" href=\"#bookland-ean-isbn\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id19\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de autodetecci\u00f3n<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>En el modo de detecci\u00f3n autom\u00e1tica, el esc\u00e1ner detectar\u00e1 el brillo del entorno circundante. Cuando el brillo cambia, el escaneo se activa. El escaneo termina cuando el escaneo es exitoso o el tiempo de escaneo excede el tiempo de trabajo \u00fanico. Independientemente de si el \u00faltimo escaneo fue exitoso o fall\u00f3, se volver\u00e1 a detectar el brillo del entorno circundante.</p>", "a[href=\"barcode.html#gs1-128-ucc-ean-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">GS1-128 (UCC/EAN-128)<a class=\"headerlink\" href=\"#gs1-128-ucc-ean-128\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id22\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes del sistema<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Restaurar ajustes por defecto<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Cuando ocurre un error desconocido en el esc\u00e1ner, puede reiniciar el esc\u00e1ner restaurando la configuraci\u00f3n predeterminada.</p>", "a[href=\"barcode.html#issn\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">ISSN<a class=\"headerlink\" href=\"#issn\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id90\" title=\"Link to this heading\">#</a></h3><p>Convertir a EAN13 cuando est\u00e1 desactivado</p>", "a[href=\"barcode.html#upc-e\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-E<a class=\"headerlink\" href=\"#upc-e\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id3\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#pdf417\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">PDF417<a class=\"headerlink\" href=\"#pdf417\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id80\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#codabar\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codabar<a class=\"headerlink\" href=\"#codabar\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id67\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Symbolog\u00edas<a class=\"headerlink\" href=\"#symbologies\" title=\"Link to this heading\">#</a></h1><h2>Todas las Symbologies<a class=\"headerlink\" href=\"#all-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#aztec-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Aztec Code<a class=\"headerlink\" href=\"#aztec-code\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id87\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html#character-encoding-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configuraci\u00f3n de codificaci\u00f3n de caracteres<a class=\"headerlink\" href=\"#character-encoding-settings\" title=\"Link to this heading\">#</a></h2><h3>Tipos originales<a class=\"headerlink\" href=\"#original-types\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#msi-msi-plessey\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">MSI/MSI Plessey<a class=\"headerlink\" href=\"#msi-msi-plessey\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id73\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-32\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">C\u00f3digo 32<a class=\"headerlink\" href=\"#code-32\" title=\"Link to this heading\">#</a></h2><h3>Convierte c\u00f3digo 39 a c\u00f3digo 32 (italiano c\u00f3digo utico)<a class=\"headerlink\" href=\"#convert-code-39-to-code-32-italian-pharmaceutical-code\" title=\"Link to this heading\">#</a></h3><p>El c\u00f3digo 32 es una variaci\u00f3n del c\u00f3digo 39 utilizado por la industria farmac\u00e9utica italiana. Escanea el c\u00f3digo de barras apropiado a continuaci\u00f3n para activar o desactivar la conversi\u00f3n del c\u00f3digo 39 al c\u00f3digo 32.</p>", "a[href=\"barcode.html#ean-8\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-8<a class=\"headerlink\" href=\"#ean-8\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id9\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#isbt-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">ISBT 128<a class=\"headerlink\" href=\"#isbt-128\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id27\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de escaneo<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Modo lanzador de teclas<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Pulse el bot\u00f3n para activar el escaneo, y suelte el bot\u00f3n para finalizar la exploraci\u00f3n. El escaneo termina cuando el escaneo es exitoso o el tiempo de lectura excede el tiempo de lectura simple.</p>", "a[href=\"barcode.html#data-matrix-dm\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Matrimonio de datos (DM)<a class=\"headerlink\" href=\"#data-matrix-dm\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id83\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#d-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Symbolog\u00edas 1D<a class=\"headerlink\" href=\"#d-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#code-39\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">C\u00f3digo 39<a class=\"headerlink\" href=\"#code-39\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id28\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#matrix-25\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Matriz 25<a class=\"headerlink\" href=\"#matrix-25\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id55\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#ean-13\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-13<a class=\"headerlink\" href=\"#ean-13\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id14\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html#transmit-code-id-character\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Trassmit C\u00f3digo ID Car\u00e1cter<a class=\"headerlink\" href=\"#transmit-code-id-character\" title=\"Link to this heading\">#</a></h2><p>Un caracter de c\u00f3digo identifica el tipo de c\u00f3digo de un c\u00f3digo escaneado. Esto puede ser \u00fatil cuando se decodifica m\u00e1s de un tipo de c\u00f3digo. El caracter de c\u00f3digo ID se inserta entre el caracter de prefijo (si se selecciona) y el s\u00edmbolo decodificado.</p>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Idioma del teclado<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Estados Unidos<a class=\"headerlink\" href=\"#america\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#interleaved-2-of-5-itf\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Intervalado 2 de 5/ITF<a class=\"headerlink\" href=\"#interleaved-2-of-5-itf\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id43\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Restaurar ajustes por defecto<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Cuando ocurre un error desconocido en el esc\u00e1ner, puede reiniciar el esc\u00e1ner restaurando la configuraci\u00f3n predeterminada.</p>", "a[href=\"barcode.html#upc-a\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-A<a class=\"headerlink\" href=\"#upc-a\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#enable-disable\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#l5-wired-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Gu\u00eda de configuraci\u00f3n r\u00e1pida del esc\u00e1ner con cable <strong>L5</strong><a class=\"headerlink\" href=\"#l5-wired-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"character.html#end-character-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configuraci\u00f3n de End Caracter<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>El car\u00e1cter final se a\u00f1ade despu\u00e9s de los datos decodificados en el formato de datos decodificados + car\u00e1cter final.</p>", "a[href=\"barcode.html#discrete-2-of-5-industrial-2-of-5-ind25\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Discreta 2 de 5/Industrial 2 de 5/IND25<a class=\"headerlink\" href=\"#discrete-2-of-5-industrial-2-of-5-ind25\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id49\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#gs1-databar-rss\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Barra de datos/RSS de GS1<a class=\"headerlink\" href=\"#gs1-databar-rss\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id79\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-11\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">C\u00f3digo 11<a class=\"headerlink\" href=\"#code-11\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id37\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#digital-barcode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">C\u00f3digo de barras digital<a class=\"headerlink\" href=\"#digital-barcode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#block-barcodes-with-urls\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bloquear c\u00f3digos de barras con URLs<a class=\"headerlink\" href=\"#block-barcodes-with-urls\" title=\"Link to this heading\">#</a></h2><p>Bloquea el escaneo de c\u00f3digos QR URL comenzando con <code class=\"docutils literal notranslate\"><span class=\"pre\">http://</span></code>, <code class=\"docutils literal notranslate\"><span class=\"pre\">https://</span></code></p>", "a[href=\"scanmode.html#same-code-delay-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configuraci\u00f3n del mismo c\u00f3digo de retraso<a class=\"headerlink\" href=\"#same-code-delay-settings\" title=\"Link to this heading\">#</a></h2><p>Para evitar que el mismo c\u00f3digo de barras se escanee varias veces en <a class=\"reference internal\" href=\"#continuous-mode\">Modo Continuo</a> y <a class=\"reference internal\" href=\"#auto-sensing-mode\">Modo de detecci\u00f3n Autom\u00e1tica</a>, puede requerir que el esc\u00e1ner espere un retardo antes de permitir que el mismo c\u00f3digo de barras sea escaneado.</p>", "a[href=\"barcode.html#qr-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">QR Code<a class=\"headerlink\" href=\"#qr-code\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id81\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#brazil-bank-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">C\u00f3digo bancario de Brasil<a class=\"headerlink\" href=\"#brazil-bank-code\" title=\"Link to this heading\">#</a></h2>", "a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo continuo<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>El esc\u00e1ner funciona continuamente. Si el escaneo tiene \u00e9xito o el tiempo de escaneo excede el tiempo de trabajo \u00fanico, el escaneo actual termina. Si el tiempo excede el tiempo especificado, el siguiente escaneo se activa autom\u00e1ticamente.</p>", "a[href=\"barcode.html#maxi-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">C\u00f3digo Maxi<a class=\"headerlink\" href=\"#maxi-code\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id86\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-93\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">C\u00f3digo 93<a class=\"headerlink\" href=\"#code-93\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id33\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Obtener versi\u00f3n de Firmware<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#all-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Todas las Symbologies<a class=\"headerlink\" href=\"#all-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#han-xin-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Han Xin COde<a class=\"headerlink\" href=\"#han-xin-code\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id88\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes del teclado<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Configuraci\u00f3n de codificaci\u00f3n de caracteres<a class=\"headerlink\" href=\"#character-encoding-settings\" title=\"Link to this heading\">#</a></h2><h3>Tipos originales<a class=\"headerlink\" href=\"#original-types\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#id1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Symbolog\u00edas 2D<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#d-reverse-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Simbolog\u00edas inversas 1D<a class=\"headerlink\" href=\"#d-reverse-symbologies\" title=\"Link to this heading\">#</a></h2>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
